	function toCSV(text){
		tmp=text.split(/\r?\n/);
		out="";
		for(i=0;i<tmp.length-1;i++){
			tmp2=tmp[i].split(/\s+/);
			for(j=0;j<tmp2.length;j++){
				// multiplies the 3rd and 4th column by .001 to turn into seconds
				if (j == 3 || j == 4){
					out=out+""+(tmp2[j] * 0.001) +","
				}
				else{
					out=out+""+tmp2[j]+","
				}
				
			}
			out=out+"\n"
		}return out
	}
    function saveToFile(data){
        var xmlhttp;
        var date = new Date()
        var file_date = date.getFullYear() + "_" + date.getMonth() + "_" +date.getDate() + "_" + date.getHours() + date.getMinutes()
        
        var user = prompt("Please Enter your Name:");
        var file_name = "DP-"+ user + "-" + file_date + ".csv"

        // Neded to match the PsychoPy outputs
        var head1 = "Orginal File Name:,"+file_name+",Time:,"+file_date+",Parameter File:,None:FromPsyToolkit,Event Codes: \n"
        var head2 = "trial_number,trial_type,event_code,absolute_time,response_time,result\n"
        
        //https://stackoverflow.com/questions/26961750/write-server-text-files-with-ajax
        if (window.XMLHttpRequest)
             {// code for IE7+, Firefox, Chrome, Opera, Safari
                  xmlhttp=new XMLHttpRequest();
                  }
        else
              {// code for IE6, IE5
                    xmlhttp=new ActiveXObject("Microsoft.XMLHTTP");
                    }
        xmlhttp.onreadystatechange=function()
          {
                if (xmlhttp.readyState==4 && xmlhttp.status==200)
                    {
                        console.log('Saved the files dude')
                        alert("Thank You! Your Data has been recorded!")
                    }
          }

        xmlhttp.open("POST","phpwrite2.php",true);
        xmlhttp.setRequestHeader("Content-type","application/x-www-form-urlencoded");
        // sends HTTP POST to php to write a file on the server 
        xmlhttp.send("name="+file_name+"&content="+head1+head2+data+"\n")
    }
